import React, {useState, useEffect} from "react";

function FishList() {
    const [fish, setFish] = useState([]);

    useEffect(() => {
        fetch("https://acnhapi.com/v1/fish")
        .then((r) => r.json())
        .then((fish) => setFish(fish));

}, []);}

